import React from 'react';
import './style.css';
import { BrowserRouter, Route, Link,Switch } from 'react-router-dom';


export const SideBar = () =>{
	return(
		<div className="container">
			<ul>
            <li><Link to='/'>Stories</Link></li>
            <li><Link to='/bright'>Bright</Link></li>
          </ul>
		</div>
	);
}
